const UserInput = () => {

    return (

       <form className={classes.todo}>
        <input 
        type='text' 
        className={classes.input} 
        placeholder='Enter your task here'  >
        </input>

        <button 
        type='submit' className={classes.button}> Add</button>


       </form>



    );
};


export default UserInput;
